import '../App.css';
import styled from 'styled-components';

function Shuryo() {
  const Image = styled.iframe `
  width:100%;
  megin:0 auto;
  `;
  return (
    <embed src="PDFのURL" type="application/pdf" width="100%" height="100%" />
  );
}

export default Shuryo;
